import React from "react";
import SignUpButton from "../components/SignUpButton";
import '../style.css';


const Landing = () => (
  <div>
    <h1>Vocabulary Trainer</h1>
    <h2>Log in or sign up!</h2>
    <SignUpButton/>
  </div>
);


export default Landing;
